import styled from 'styled-components';

export const Container = styled.div`
  text-align: center;
`;

export const ErrorButton = styled.button`
  background: #03a9fa;
  border: none;
  border-radius: 4px;
  padding: 10px 12px;
  cursor: pointer;
  color: #fff;
`;
